import React, { useState } from 'react';
import './CropImage.css';
import { useNavigate } from 'react-router-dom';
import mangoLogo from '../../assets/Logo_white.png';
import userProfileImg from '../../assets/profile.jpg';
import JSZip from "jszip";
import { saveAs } from "file-saver";

const CropImage = () => {
    const [dragActive, setDragActive] = useState(false);
    const [selectedFiles, setSelectedFiles] = useState([]);
    const [croppedImage, setCroppedImage] = useState(null);
    const navigate = useNavigate();

    const handleDashboard = () => navigate('/dashboardpage');
    const handleFeatureAnalysis = () => navigate('/featureanalysis');
    const handleBruiseAreaCalculation = () => navigate('/bruiseareacalculation');
    const handleAboutUs = () => navigate('/aboutuspage');
    const handleContactUs = () => navigate('/contactuspage');
    const handleUserProfile = () => navigate('/userprofilepage');

    const handleFileChange = (event) => {
        const files = Array.from(event.target.files);
        setSelectedFiles(files);
    };

    const handleCropImage = () => {
        // Simple cropping logic (you can replace this with a cropping library or custom logic)
        if (selectedFiles.length > 0) {
            const img = new Image();
            img.src = URL.createObjectURL(selectedFiles[0]);
            img.onload = () => {
                const canvas = document.createElement('canvas');
                const ctx = canvas.getContext('2d');
                canvas.width = 200; // Example crop width
                canvas.height = 200; // Example crop height
                ctx.drawImage(img, 0, 0, 200, 200);
                setCroppedImage(canvas.toDataURL('image/png'));
            };
        }
    };

    return (
        <div className="crop-image-page">
            <nav className="navbar">
                <div className="navbar-brand">
                    <img src={mangoLogo} alt="Mango Logo" className="mango-logo" />
                </div>
                <div className="navbar-links">
                    <button onClick={handleDashboard}>Dashboard</button>
                    <button onClick={handleBruiseAreaCalculation}>Bruised Area Calculation</button>
                    <button onClick={handleFeatureAnalysis}>Feature Analysis</button>
                    <button>Crop Image</button>
                    <button onClick={handleAboutUs}>About Us</button>
                    <button onClick={handleContactUs}>Contact Us</button>
                </div>
                <div className="navbar-profile" onClick={handleUserProfile}>
                    <img src={userProfileImg} alt="User Profile" className="user-profile" />
                </div>
            </nav>

            <div className="crop-image-content">
                <h1>Crop Image</h1>
                <p>Upload an image and crop it as needed.</p>

                <div className="file-upload-container">
                    <div
                        className={`file-dropzone ${dragActive ? 'drag-active' : ''}`}
                        onDragOver={(e) => { e.preventDefault(); setDragActive(true); }}
                        onDragLeave={() => setDragActive(false)}
                        onDrop={(e) => { 
                            e.preventDefault();
                            setDragActive(false);
                            const files = Array.from(e.dataTransfer.files);
                            handleFileChange({ target: { files } });
                        }}
                    >
                        <p>Drag & Drop your images here or</p>
                        <input
                            type="file"
                            onChange={handleFileChange}
                            accept=".jpg,.jpeg,.png"
                            multiple
                        />
                        <label htmlFor="file-upload">Browse 📁</label>
                    </div>
                    <div className="selected-files">
                        {selectedFiles.length > 0 && (
                            <ul>
                                {selectedFiles.map((file, index) => (
                                    <li key={index}>{file.name}</li>
                                ))}
                            </ul>
                        )}
                    </div>
                </div>

                <div className="action-buttons">
                    <button className="bt crop-image-bt" onClick={handleCropImage}>Crop Image</button>
                </div>

                {croppedImage && (
                    <div className="cropped-image-preview">
                        <h3>Cropped Image:</h3>
                        <img src={croppedImage} alt="Cropped" className="cropped-image" />
                    </div>
                )}
            </div>

            <footer>
                <p>Mae Fah Luang University 333 Moo 1, Thasud, Muang, Chiang Rai 57100</p>
            </footer>
        </div>
    );
};

export default CropImage;
